airBaltic Club – lojalitātes programma katram ceļotājam!
Pievienojies airBaltic Club jau tagad un sāc krāt punktus un zīmogus!

Galvenās priekšrocības:

• Izmanto digitālo karti vai pievieno to viedtālruņa mobilajā maciņā, lai krātu punktus;
• Aplūko savu airBaltic Club punktu uzkrājumu un darījumus;
• Pievienojies zīmodziņu kartei un krāj zīmogus, lai iegūtu vērtīgas balvas;
• Uzzini par jaunākajiem piedāvājumiem un īpašām atlaidēm;
• Iegūsti tūlītējas balvas Shake&Win izlozē – atver lietotni, pakrati savu viedtālruni un laimē;
• Rezervē un reģistrējies airBaltic lidojumiem, aplūko savu rezervāciju un pievieno ceļojumam papildpakalpojumus – bagāžu, sēdvietas rezervāciju, maltīti uz klāja un daudzus citus servisus.

Krāj punktus pie partneriem, tērē punktus balvās!

• Iegūsti punktus katru reizi, kad lido ar airBaltic vai izmanto citu partneru pakalpojumus - Booking.com, Rentalcars.com, LSG Sky Chefs un citus;
• Izmanto sakrātos punktus, lai palutinātu sevi ar dāvanām – airBaltic Club punktu aviobiļetēm uz vairāk nekā 70 galamērķiem, klases paaugstināšanu, airBaltic dāvanu kartēm, bagāžas kuponiem un citām vilinošām balvām.

Ar zīmodziņu karti iegūsi pat vairāk punktu un ceļošanas priekšrocību, kā arī pietuvosies airBaltic Club punktu aviobiļetes saņemšanai daudz ātrāk!

• Lejupielādē airBaltic Club mobile lietotni un spied uz Zīmodziņu kartes ikonas;
• Sāc krāt zīmogus, lai saņemtu vērtīgas balvas – atlaides lidojumiem, airBaltic Club punktu aviobiļeti, sēdvietas rezervācijas un smagās rokas bagāžas kuponu, kā arī papildu punktus;
• Jo vairāk lidosi, jo vairāk priekšrocību saņemsi! 

Nepalaid garām lieliskas balvas – pievienojies airBaltic Club, lejupielādē lietotni un sāc jau tagad!

**English version below**
TaxiMe спестява време и главоболия, като ти изпраща подбран таксиметров шофьор бързо и лесно. 
- Поръчваш такси без да говориш с диспечер, с две докосвания, директно от твоя iPhone или iPad;
- Получаваш такси на стандартна тарифа с подбран шофьор;
- Разполагаш с пълна информация за шофьора и колата;
- Предварително знаеш приблизителната стойност на курса;
- Оценяваш шофьора в края на пътуването, с което влияеш на подбора на шофьори.

Важно: TaxiMe работи само с предварително подбрани, лицензирани таксиметрови шофьори, с които се возиш на нормални тарифи в София (по-ниски или равни на: 1.07 лв/км дневна; 1.24 лв/км нощна).

Харесай ни във Facebook на https://www.facebook.com/TaxiMeApp
Последвай ни в Twitter на https://twitter.com/TaxiMeApp

------------ English version ----------

TaxiMe saves time and hassle by connecting you to a quality taxi driver as quickly as possible.
- Request a taxi ride in two taps, directly from your iPhone or iPad;
- Get a taxi with a selected, quality driver at а standard rate;
- Have full information about the driver, car, and rate;
- Know in advance the estimated cost of your trip;
- Rate the driver and influence the selection of drivers.

NB: TaxiMe works only with selected, quality taxi drivers who charge standard taxi rates in Sofia (lower or equal to: 1.07 lv./km day and 1.24 lv./km night).  

